(let [result (zipmap cascades (map (fn [c] (remove #(> % 20) (contact-latency c t0 tmax :distribution))) cascades))
       dat {:yvar (apply concat (vals result))
            :xvar (mapcat (fn [[k v]] (repeat (count v) (element-name k))) result)
            }]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xvar :yvar] ]
         [:geom_boxplot]
    	 [:stat_summary {:fun.y :mean, :geom "point" :shape 1 :size 2}]
         [:guides {:fill "none"}]
         [:xlab "Subclass"]
         [:ylab "Latency in hours"]
         [:theme_bw]
         [:ggtitle "Average contact lateny"])]
      {:width 6 :height 6 }))
